import React from "react";

function Jumbotron({ children }) {
  return (
    <div
      style={{ 
        height: 200, 
        marginTop: 30,
        // clear: "both", 
        display: "flex",
        justifyContent: "center",
        paddingTop: 50, 
        paddingBottom: 50, 
        textAlign: "center" }}
      className="jumbotron"
    >
      {children}
    </div>
  );
}

export default Jumbotron;
